import loadVideo from '../assets/loading.mp4';

const Loading = () => {
  return (
    <div className='h-screen absolute justify-center align-center'>
      <video src={loadVideo} autoPlay loop muted className='h-full w-60'></video>
    </div>
  );
};

export default Loading;
